import React, { useState, useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import Webcam from 'react-webcam';
import * as faceapi from 'face-api.js';

const Login = () => {
    const navigate = useNavigate();
    const webcamRef = useRef(null);
    const [authStep, setAuthStep] = useState('credentials');
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');
    const [faceDetected, setFaceDetected] = useState(false);
    const [faceMatched, setFaceMatched] = useState(false);

    const [formData, setFormData] = useState({
        email: '',
        password: '',
        aadharNumber: ''
    });

    const loadFaceDetectionModels = async () => {
        try {
            await Promise.all([
                faceapi.nets.tinyFaceDetector.loadFromUri('/models'),
                faceapi.nets.faceLandmark68Net.loadFromUri('/models'),
                faceapi.nets.faceRecognitionNet.loadFromUri('/models')
            ]);
        } catch (error) {
            setError('Failed to load face detection. Please refresh.');
        }
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        if (name === 'aadharNumber') {
            const numericValue = value.replace(/\D/g, '');
            setFormData(prev => ({ ...prev, [name]: numericValue }));
        } else {
            setFormData(prev => ({ ...prev, [name]: value }));
        }
        setError('');
    };

    const handleCredentialsSubmit = async (e) => {
        e.preventDefault();
        if (!validateEmail(formData.email)) {
            setError('Please enter a valid email');
            return;
        }
        if (formData.password.length < 6) {
            setError('Password must be at least 6 characters');
            return;
        }

        setLoading(true);
        try {
            await new Promise(resolve => setTimeout(resolve, 1000));
            setAuthStep('aadhar');
        } catch (error) {
            setError('Authentication failed');
        } finally {
            setLoading(false);
        }
    };

    const handleAadharSubmit = async () => {
        if (formData.aadharNumber.length !== 12) {
            setError('Please enter a valid 12-digit Aadhar number');
            return;
        }

        setLoading(true);
        try {
            await new Promise(resolve => setTimeout(resolve, 1000));
            await loadFaceDetectionModels();
            setAuthStep('face');
        } catch (error) {
            setError('Aadhar verification failed');
        } finally {
            setLoading(false);
        }
    };

    const handleFaceDetection = async () => {
        const interval = setInterval(async () => {
            try {
                if (webcamRef.current && webcamRef.current.video) {
                    const detection = await faceapi
                        .detectSingleFace(webcamRef.current.video, new faceapi.TinyFaceDetectorOptions())
                        .withFaceLandmarks();

                    if (detection) {
                        setFaceDetected(true);
                        clearInterval(interval);
                        setTimeout(() => {
                            setFaceMatched(true);
                            setTimeout(() => navigate('/dashboard'), 1000);
                        }, 1500);
                    }
                }
            } catch (error) {
                console.error('Face detection error:', error);
            }
        }, 100);

        return () => clearInterval(interval);
    };

    const validateEmail = (email) => {
        return /^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(email);
    };

    return (
        <div className="auth-container">
            <div className="auth-card">
                <h2>Secure Login</h2>
                {error && <div className="error-message">{error}</div>}

                {authStep === 'credentials' && (
                    <form onSubmit={handleCredentialsSubmit}>
                        <div className="form-group">
                            <label htmlFor="email">Email</label>
                            <input
                                type="email"
                                id="email"
                                name="email"
                                value={formData.email}
                                onChange={handleInputChange}
                                placeholder="Enter your email"
                                disabled={loading}
                            />
                        </div>
                        <div className="form-group">
                            <label htmlFor="password">Password</label>
                            <input
                                type="password"
                                id="password"
                                name="password"
                                value={formData.password}
                                onChange={handleInputChange}
                                placeholder="Enter your password"
                                disabled={loading}
                            />
                        </div>
                        <button
                            className="auth-button"
                            type="submit"
                            disabled={loading}
                        >
                            {loading ? "Verifying..." : "Next"}
                        </button>
                        <button
                            className="link-button"
                            onClick={() => navigate("/signup")}
                            type="button"
                            disabled={loading}
                        >
                            Don't have an account? Sign Up
                        </button>
                    </form>
                )}

                {authStep === 'aadhar' && (
                    <div className="form-group">
                        <label htmlFor="aadhar">Aadhar Number</label>
                        <input
                            type="text"
                            id="aadhar"
                            name="aadharNumber"
                            value={formData.aadharNumber}
                            onChange={handleInputChange}
                            placeholder="Enter 12-digit Aadhar number"
                            maxLength={12}
                            disabled={loading}
                        />
                        <button
                            className="auth-button"
                            onClick={handleAadharSubmit}
                            disabled={loading || formData.aadharNumber.length !== 12}
                        >
                            {loading ? "Verifying..." : "Verify Aadhar"}
                        </button>
                        <button
                            className="auth-button secondary"
                            onClick={() => setAuthStep('credentials')}
                            disabled={loading}
                        >
                            Back
                        </button>
                    </div>
                )}

                {authStep === 'face' && (
                    <div className="face-auth-container">
                        <div className="webcam-container">
                            <Webcam
                                ref={webcamRef}
                                screenshotFormat="image/jpeg"
                                className="webcam"
                                onUserMedia={handleFaceDetection}
                            />
                            {faceDetected && (
                                <div className="face-detected">
                                    {faceMatched ? 'Face Verified âœ“' : 'Detecting Face...'}
                                </div>
                            )}
                        </div>
                        {faceMatched && (
                            <div className="success-message">
                                Authentication successful! Redirecting...
                            </div>
                        )}
                        <button
                            className="auth-button secondary"
                            onClick={() => setAuthStep('aadhar')}
                            disabled={loading}
                        >
                            Back
                        </button>
                    </div>
                )}
            </div>
        </div>
    );
};

export default Login;
